import React, { useEffect } from "react";
import { Table, Badge } from "react-bootstrap";
import { useSelector, useDispatch } from "react-redux";
import { getOmnibusTaller } from "./services";

const OmnibusTaller = () => {
  const state = useSelector((state) => state);
  const dispatch = useDispatch();

  const { omnibustaller } = state.omnibus;
  useEffect(() => {
    dispatch(getOmnibusTaller());
  }, []);

  console.log("ver omnibus-taller", omnibustaller);
  return (
    <>
      <div>
        <Badge variant="info">Disponible</Badge>
      </div>
      <Table striped bordered hover variant="dark">
        <thead>
          <tr>
            <th>#</th>
            <th>Numero</th>
            <th>Chapa</th>
            <th>Disponible</th>
          </tr>
        </thead>
        <tbody>
          {omnibustaller.map((el, index) => (
            <tr key={index}>
              <td>1</td>
              <td>{el.numero}</td>
              <td>{el.chapa}</td>
              <td>
                {el.disponible ? (
                  <div>
                    <Badge bg="success">Disponible</Badge>
                  </div>
                ) : (
                  <div>
                    <Badge variant="danger">Taller</Badge>
                  </div>
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </Table>
    </>
  );
};

export default OmnibusTaller;
